5.  P(T|U):  Den mest vanlige tilfældige prøvedata gruppe, der er forbindet med den mest vanlige udbredne prøvedata gruppe, U.
6.  P(D|T):  Den mest vanlige førende prøvedata gruppe, der er forbindet med den mest vanlige tilfældige prøvedata gruppe, T.
7.  P(U|D|T):  Den mest vanlige udbredne førende prøvedata gruppe, der er forbindet med den mest vanlige førende prøvedata gruppe, D og den mest vanlige tilfældige prøvedata gruppe, T."

